import React from 'react';
import CarCard from './CarCard';

const CarGrid = ({ cars }) => {
    return (
        <div style={{
            display: 'grid',
            gridTemplateColumns: 'repeat(2, 1fr)',
            gap: '20px',
            padding: '20px',
            maxWidth: '1200px',
            margin: '0 auto'
        }}>
            {cars.map(car => (
                <CarCard key={car.id} car={car} />
            ))}
        </div>
    );
};

export default CarGrid;
